import React from 'react';

function Home() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to My Website</h1>
      <p>This is my first Home Page built with React.js!</p>
    </div>
  );
}

export default Home;
